package p2p

import "testing"
import "encoding/hex"

import "github.com/satori/go.uuid"

func TestNodeDataSerialisation(t *testing.T) {

	// this structure has been manually pulled from wireshark stream
	// // 0108 header removed and is now part of levin data header
	raw_data := "096e6f64655f646174610c100a6c6f63616c5f74696d6505d56b2a5a00000000076d795f706f727406000000000a6e6574776f726b5f69640a401230f171610441611731008216a1a11107706565725f696405ced52f43e6e7a04e"
	raw_data_blob, _ := hex.DecodeString(raw_data)

	var node Node_Data

	err := node.DeSerialize(raw_data_blob)

	if err != nil {
		t.Error("DeSerializeNodeData Failed\n")
		return
	}

	// now serialize once again

	serialised, slen := node.Serialize()
	if raw_data != hex.EncodeToString(serialised) {
		t.Error("SerializeNodeData Failed")
	}

	if slen != 91 {
		t.Error("SerializeNodeData Failed")
	}

	// now lets verify the data
	if node.Local_time != 0x5a2a6bd5 {
		t.Error("SerializeNodeData Failed")
	}

	if node.Local_Port != 0 {
		t.Error("SerializeNodeData Failed")
	}

	if node.Peer_ID != 0x4ea0e7e6432fd5ce {
		t.Error("SerializeNodeData Failed")
	}

	// network id

	var nid uuid.UUID

	nid.UnmarshalBinary([]byte{18, 48, 241, 113, 97, 4, 65, 97, 23, 49, 0, 130, 22, 161, 161, 17})

	if uuid.Equal(nid, node.Network_UUID) == false {
		t.Error("SerializeNodeData Failed")
	}

}

